import time
class Solution(object):
    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        letterIndexes = {}
        for i in range(len(s)):
            if s[i] in letterIndexes:
                letterIndexes[s[i]].append(i)
            else:
                letterIndexes[s[i]] = [i]
        tIndexes = []
        for ch in t:
            if ch in letterIndexes:
                tIndexes.append(letterIndexes[ch])
            else:
                return 0
        #print(tIndexes)
        if len(tIndexes) == 1:
            return len(tIndexes[0])
        boxes = [None] * len(s)
        i = 0
        for idx in tIndexes[0]:
            try:
                if tIndexes[1][-1] <= idx:
                    continue
                while tIndexes[1][i] <= idx:
                    i += 1
                for j in tIndexes[1][i:]:
                    if boxes[j]:
                        boxes[j] += 1
                    else:
                        boxes[j] = 1
            except:
                break

        for layer in tIndexes[2:]:
            #print(boxes)
            i = 0
            for b in range(len(boxes)):
                if boxes[b]:
                    try:
                        bn = boxes[b][0]
                        boxes[b] = boxes[b][1]
                    except:
                        bn = boxes[b]
                        boxes[b] = None

                    if layer[-1] <= b:
                        continue
                    while layer[i] <= b:
                        i += 1
                    for j in layer[i:]:
                        if boxes[j]:
                            try:
                                boxes[j][1] += bn
                            except:
                                boxes[j] = [boxes[j], bn]
                        else:
                            boxes[j] = [0, bn]

        ssum = 0
        for box in boxes:
            if box:
                ssum += box
        return ssum



